import { FaFacebook } from 'react-icons/fa';
import { FaInstagram } from 'react-icons/fa';
import { FaLinkedin } from 'react-icons/fa';
import styles from "./Footer.module.css"
function Footer(){
  return (
  <footer>
   <li>
   <FaFacebook/>
   </li>
   <li>
   <FaInstagram/>
   </li>
   <li>
   <FaLinkedin/>
   </li>
  </footer>
  )
}

export default Footer
